const App = () => {
  const now = new Date ()
  const a = 10
  const b = 20

  return (
  <div>
    <p>Hello hello world, it is {now.toString()} my dudes</p>
    <p>
      {a} plus {b} is {a + b}
    </p>
  </div>
)
}

export default App;
